import React, { useState } from "react";
import {
  Alert,
  Modal,
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  Button,
  FlatList,
  Image,
} from "react-native";
import { SafeAreaView } from "react-native-safe-area-context";
import connect from "../api/connect";

const News = () => {
  const [tabs, setTabs] = useState();

  const request = connect.get("/Release", {}).then((result) => {
    setTabs(result.data);
  });
  return (
    <FlatList
      data={tabs}
      renderItem={({ item }) => {
        return (
          <TouchableOpacity>
            <Text>{item.name}</Text>
          </TouchableOpacity>
        );
      }}
    />
  );
};

const styles = StyleSheet.create({});

export default News;
